package com.in_out.repo;import java.util.List;import org.springframework.data.jpa.repository.JpaRepository;import org.springframework.data.jpa.repository.Query;import com.in_out.model.Officer;public interface OfficerRepository extends JpaRepository<Officer, Long> {  Officer findByAadharNumber(String paramString);    @Query("SELECT o.fullName FROM Officer o WHERE o.fullName IS NOT NULL")  List<String> findFullNames();}